INSERT INTO `posts` (`id`, `title`, `description`, `img`, `uid`) VALUES
(0, 'Classic Culture Triangle 3 Days private Tour 2 Nights Accommodations ', 'This private escorted tour offers a brief introduction into the culture and history of Sri Lanka. Climb the ancient fortress of Sigiriya Rock, and visit Dambulla Cave Temple, impressively lined with ancient paintings and abounding with Buddhas of all shapes and sizes. Enjoy a stay in historic, view impressive Polonnaruwa  UNESCO World Heritage Site and then bottle feed the baby Elephants at Pinnawala before heading to your chosen beach resort.', , 0);
INSERT INTO `posts` (`id`, `title`, `description`, `img`, `uid`) VALUES
(1, 'Ruwanwalisaya Anuradapura', 'Anuradhapura is one of the ancient capitals of Sri Lanka, famous for its well-preserved ruins of ancient Lankan civilization. From the 4th century BC, it was the capital of Sri Lanka until the beginning of the 11th century AD. During this period it remained one of the most stable and durable centres of political power and urban life in South Asia. The ancient city, considered sacred to the Buddhist world, is today surrounded by monasteries covering an area of over sixteen square miles.', , 2);
INSERT INTO `posts` (`id`, `title`, `description`, `img`, `uid`) VALUES
(2, 'Arugam Bay', 'The surfer??s paradise, Arugam bay located 320 km from Colombo and belived to be one of  the top 10\'s surfer points in the world, with water temperature of 24-28C all around the year, where you can surf without wetsuit, it is small remote fishing village located southern east of Sri Lanka and on the edge of Yala national park', , 2);
INSERT INTO `posts` (`id`, `title`, `description`, `img`, `uid`) VALUES
(3, 'Adams Peak ( Sri Pada)', 'Though not the highest mountain of Sri Lanka, the striking pyramid of Adam\'s Peak (7,360 ft) is certainly the most remarkable. A depression in the rocky summit resembles a huge footprint, which has been venerated as a sacred sigh from remote antiquity. This was identified by Buddhists as the Buddha\'s footprint, by Hindus as that of Shivas, and by Muslims as Adam\'s. Later the Portuguese attributed it to St. Thomas the Apostle.  ', '', 1);
INSERT INTO `posts` (`id`, `title`, `description`, `img`, `uid`) VALUES
(4, 'Batticoalo', 'Batticaloa is in the eastern coast of Sri Lanka on a flat coastal plain boarded by the Indian Ocean. There are several lagoons within the batticaloa beach, Batticaloa beaches are sandy and located along 4 /5 km shoreline in the city and further extend through the  neighbouring places', , 1);

